  }));
};

UilImageDownload.propTypes = {
  color: PropTypes.string,
  size: PropTypes.oneOfType([PropTypes.string, PropTypes.number]),
};

UilImageDownload.defaultProps = {
  color: 'currentColor',
  size: '24',
};

export default UilImageDownload;
